import React from 'react'
import { Routes, Route } from 'react-router-dom';
import LoginPage from './pages/LoginPage'

const App = () => {
  return (
    <div>
      <h1>Movies - Subscriptions Web Site</h1>
      <Routes>
        <Route path='/' element={<LoginPage />} />
      </Routes>
    </div>
  )
}

export default App
